        title: "Student Report Card",
        info: "It aims to know the grade of the student by giving the appropriate marks."
    },
    {
        imgsrc: web,
        title: "AI Projects",
        info: "A platform where you will be able to find most of the AI based projects.",
    },
    {
        imgsrc: web,
        title: "Coding Challenges",
        info: "Check out most of the coding challenges that has been solved. You can also contribute your work by solving the problem in another languages.",

    },
    {
        imgsrc: web,
        title: "Gamify-2D games",
        info: "This app was made using Android Studio. The app contains 2d games that the user may like to play by just downloading it.",

    },
    {
        imgsrc: web,
        title: "Employee Database Management System",
        info: "It is a Java application project where the Employees can added by taking the required details. It uses the Sqlite on machine to access the database.",

    },
    {
        imgsrc: web,
        title: "Online Education Discussion Forum",
        info: "A Forum that can help the people to get the information by seeing the upvotes on the answers given by the forum members.",
    },
    
    {
        imgsrc: web,
        title: "The Unique Blogger - Blogs",
        info: "A blogger site where you can find the Information and some Articles based on the new technology and the growing market.",
    },
];

export default Sdata;
